import React from 'react';
import logo from './../logo.svg';
import './Header.css';

class Header extends React.Component {
  changeAppModeToEdit = () => this.props.changeAppModeToEdit();
  changeAppModeToNonEdit = () => this.props.changeAppModeToNonEdit();
  render() {
    return (
      <header>
        <img className="heroLogo" alt="CV Builder Logo" src={logo} />
        <h1>CV Builder</h1>
        <button onClick={this.changeAppModeToEdit}>EDIT MODE</button>
        <button onClick={this.changeAppModeToNonEdit}>VIEW MODE</button>
      </header>
    );
  }
}

export default Header;

